# AVERAGINE DISTRIBUTION
# ----------------------

def makeAveragineDist(composition, massRange, relIntTreshold=0.5, fwhm=0.1, charge=0):
    """Calculate averagine distributions for given composition."""
    
    # make block formula
    blockFormula = ''
    for element in composition:
        blockFormula += '%s%0.f' % (element, composition[element]*100)
    blockMass = objects.formula(blockFormula).getMass()
    
    # mass range specified
    if type(massRange) in (list, tuple):
        
        # get range
        lowRange = int(round(massRange[0]/blockMass[0]*100))
        lowRange = max(1,lowRange)
        highRange = int(round(massRange[1]/blockMass[0]*100))
        
        # calculate averagine distribution
        distribution = {}
        for x in range(lowRange, highRange):
            
            # make formula
            f = ''
            for element in composition:
                f += '%s%0.f' % (element, composition[element]*x)
            f = objects.formula(f)
            
            # calc pattern
            pattern = f.getPattern(relIntTreshold, fwhm, charge)
            mass = int(round(f.getMass()[0]))
            distribution[mass] = pattern
            
    # single mass specified
    else:
        count = int(round(massRange/blockMass[0]*100))
        count = max(1,count)
        
        # make formula
        f = ''
        for element in composition:
            f += '%s%0.f' % (element, composition[element]*count)
        f = objects.formula(f)
        
        # calc pattern
        distribution = f.getPattern(relIntTreshold, fwhm, charge)
    
    return distribution
